export async function getAllProducts(): Promise<any> {
    try {
        const request = fetch(`http://localhost:5000/api/products`);
        
        console.log(JSON.parse((await request).json()));
        

        // return (await request).json();
    }
    catch (err) {
        console.error(err);
    }
}
